import React from 'react';

export default function home(props) {
  return (
    <>
      <div className='container'>
        {props.questions.map((item) => {
          return (
            <div className='title'>
              {item.theme}
              <div>
                {item.questions.map((question) => {
                  return (
                    <div
                      onClick={() => {
                        console.log(question.text);
                      }}
                    >
                      {question.points}
                    </div>
                  );
                })}
              </div>
            </div>
          );
        })}
      </div>
    </>
  );
}
